import time
import webbrowser
import urllib.request
from os.path import expanduser
import os
import base64
import subprocess


pips = subprocess.check_output("pip list")

libs = ["PyAutoGUI", "opencv-python", "playsound"]

for lib in libs:
    if lib in str(pips):
        print(lib+" exists, skipping")
    else:
        os.system("pip install "+lib)

import pyautogui
import cv2
import playsound

webbrowser.open("https://workspace-zur3.ra.ubs.com/logon/choose-your-location/index.html", new=1, autoraise=True)

pics = {
    "country" : "",
    "mobile" : "",
    "download" : ""
}

homeDIR = expanduser("~").replace("\\", "/")
appDIR = homeDIR + "/.autoUBS/"

if(not os.path.exists(appDIR)):
    os.mkdir(appDIR)

    for pic in pics:
        f = open(appDIR+pic+".png", "wb")
        f.write(base64.standard_b64decode(pics[pic]))
        f.close()

time.sleep(3)

cLoc  = pyautogui.locateCenterOnScreen(appDIR+"country.png", confidence=0.9)
pyautogui.click(cLoc)

time.sleep(3)

mLoc  = pyautogui.locateCenterOnScreen(appDIR+"mobile.png", confidence=0.9)
pyautogui.click(mLoc)


time.sleep(20)

# notify user

dLoc  = pyautogui.locateCenterOnScreen(appDIR+"download.png", confidence=0.9)
pyautogui.click(dLoc)


for file in os.listdir(homeDIR+"/Downloads"):
    if file.endswith(".ica"):
        os.system(file)
